import Vue from 'vue'
Vue.mixin({
    methods: {
        dateNow() {
            const date = new Date();
            const fdate =
                date.getDay() +
                "/" +
                date.getMonth() +
                "/" +
                date.getFullYear() +
                " " +
                date.getHours() +
                ":" +
                date.getMinutes();
            return fdate;
        }
    }
})
